import ttkbootstrap as ttkb
from ttkbootstrap.constants import *
from tkinter import filedialog, messagebox
import Enc
import threading
import time
import base64
import tempfile
import os
#------------------------------------------------------------------------------------------------------------------------------------------
ico_base64 = b'''

...
'''

def save_temp_icon():
    icon_path = os.path.join(tempfile.gettempdir(), 'temp_icon.ico')
    with open(icon_path, 'wb') as f:
        f.write(base64.b64decode(ico_base64))
    return icon_path
icon_path = save_temp_icon()
#----------------1--------------------------------->>>>>>>>>>
root = ttkb.Window(themename="cosmo")
root.geometry("750x300+330+100")
root.iconbitmap(icon_path)
root.title("SecureBox [SF]")
root.minsize(750, 300)
root.maxsize(750, 300)
#---------------2---------------------------------->>>>>>>>>>>
nb = ttkb.Notebook(root)
nb.pack()
fr0 = ttkb.Frame(nb, width='750', height='300')
nb.add(fr0, text='Warning')
fr = ttkb.Frame(nb, width='750', height='300')
nb.add(fr, text='encryption')
fr1 = ttkb.Frame(nb, width='750', height='300')
nb.add(fr1, text='decryption')
def browse_file(entry_box):
    file_paths = filedialog.askopenfilenames(title="Select file(s) or folder(s)")
    if file_paths:
        paths_str = '; '.join(file_paths)
        entry_box.delete(0, ttkb.END)
        entry_box.insert(0, paths_str)
#--------------------------------------------------------------------------------------------------------------------------------
def WR():
    text = ttkb.Text(fr0, width=750, height=300)
    text.pack()
    tt="""
        --------------------------------------------------------------------------------------------------
        --------------------------------------------------------------------------------------------------
        --------------------------------------------------------------------------------------------------
        --------------------------------------------------------------------------------------------------
        ----------------------------------------      Warning      ---------------------------------------
        The file will be lost if you forget the password.
        Do not close the program during the encryption or decryption process. I will check the file.
              .
                   .
        --------------------------------------------------------------------------------------------------
        --------------------------------------------------------------------------------------------------
        --------------------------------------------------------------------------------------------------
        --------------------------------------------------------------------------------------------------
       """
    text.insert(ttkb.END, tt)
#--------------------------------------------------------------------------------------------------------------------------------
def win_progress(task_func):
    prog = ttkb.Toplevel(root)
    prog.geometry('320x80+580+200')
    prog.title('SecureBox [SF]')
    prog.iconbitmap(icon_path)
    prog.maxsize(320, 80)
    prog.minsize(320, 80)
    ttkb.Label(prog, text='Progress:', background='#ffffff').place(x=10,y=10)
    progress=ttkb.Progressbar(prog, bootstyle="success", length=300, mode='determinate')
    progress.pack(pady=30)
#--------------------------------------------------------------------------------------------------------------------------------
    def task():
        for i in range(101):
            progress['value'] = i
            prog.update_idletasks()
            time.sleep(0.05)
        task_func()
        prog.destroy()
    threading.Thread(target=task).start()
#------------------------------------------------------------------------------------------------------------------------------
def enc():
    ttkb.Label(fr, text='Select File to Encrypt:').place(x=50, y=100)
    entry_enc = ttkb.Entry(fr, width=60)
    entry_enc.place(x=180,y=96)
    ttkb.Button(fr, text='Browse...', command=lambda: browse_file(entry_enc)).place(x=555, y=96)
    def proEn():
        filename = entry_enc.get()
        if filename.endswith('.SF'):
            messagebox.showerror('ERROR', 'This is an encrypted file')
            return
        pro_ = ttkb.Toplevel(root)
        pro_.geometry('300x100+580+200')
        pro_.iconbitmap(icon_path)
        pro_.title("SecureBox [SF]")
        ttkb.Label(pro_,text='password the fils:', background='#ffffff').place(x=20,y=20)
        password = ttkb.Entry(pro_, width=25,)
        password.place(x=120,y=19)
        def Senc():
            files = entry_enc.get().split('; ')
            padding = lambda s : s + (32 -len(s) %32) * "*"
            key = padding(password.get()).encode('ascii')
            for file in files:
                if file.endswith('.SF'):
                    continue
                Enc.encryption(key, file.strip())
            pro_.destroy()
        ttkb.Button(pro_, text='Enter', command = lambda : win_progress(Senc)).place(x=120,y=50)
        pro_.mainloop()
    btn = ttkb.Button(fr, text='Encrypt Now', command=proEn)
    btn.place(x=320, y=150)
#--------------------------------------------------------------------------------------------------------------------------------
def dec():
    ttkb.Label(fr1, text='Select File to Decrypt:').place(x=50, y=100)
    entry_dnc = ttkb.Entry(fr1, width=60)
    entry_dnc.place(x=180,y=96)
    ttkb.Button(fr1, text='Browse...', command=lambda: browse_file(entry_dnc)).place(x=555, y=96)
    def proDe():
        filename = entry_dnc.get()
        if filename.endswith('.SF'):
            pro_ = ttkb.Toplevel(root)
            pro_.geometry('300x100+580+200')
            pro_.iconbitmap(icon_path)
            pro_.title("SecureBox [SF]")
            ttkb.Label(pro_,text='password the fils:', background='#ffffff').place(x=20,y=20)
            password_ = ttkb.Entry(pro_, width=25, show='')
            password_.place(x=120,y=19)
            def Sdec():
                files = entry_dnc.get().split('; ')
                padding = lambda s : s + (32 -len(s) %32) * "*"
                key = padding(password_.get()).encode('ascii')
                for file in files:
                    if not file.endswith('.SF'):
                        continue
                    Enc.decryption(key, file.strip())
                pro_.destroy()
            ttkb.Button(pro_, text='Enter', command=lambda: win_progress(Sdec)).place(x=120,y=50)
            pro_.mainloop()
        else:
            messagebox.showerror('ERROR', 'This file is not encrypted.')
    btn = ttkb.Button(fr1, text='Decrypt Now', command=proDe)
    btn.place(x=320, y=150)
dec()
enc()
WR()
root.mainloop()
try:
    os.remove(icon_path)
except:
    pass
